window.bookSummaryJSON = "<p>A haven for humanity. Factions forming and fracturing. The seeds of a new empire.</p> <p>Drew and his team are racing to create a system-recognized \"Habitat\". To make this happen, they must conquer more nodes, deal with an antagonistic superior officer, and possibly worst of all: Their own fear.</p> <p>Freeing the trollâ€™s sacrificial captives was only the beginning. Now the remnants of humanity must find a safe place to call home. But Nat's Park isn't the safe haven he was promised it would be. Not only do internal politics threaten to rip the survivors apart, an unknown danger haunts the stadium.</p> <p>Drew and his allies will struggle to survive in the changed world after the Advent as fate works to temper them.</p>"; 
